import React, { Component, Fragment } from 'react';

class Maping extends Component{
    render(){
        const { id, name, mobile, desc } = this.props.maping;
        return (
            <Fragment>
                <h1>{id}</h1>
                <h2>{name}</h2>
                <h3>{mobile}</h3>
                <h4>{desc}</h4>
            </Fragment>
        )
    }
}
export default Maping;
